import NextApp from 'next/app'
import { ThemeProvider, theme, CSSReset, ColorModeProvider } from '@chakra-ui/core'


class App extends NextApp {
    render() {
        const { Component } = this.props
        return (
            <ThemeProvider theme={theme}>
                <ColorModeProvider>
                    <Component />
                </ColorModeProvider>
            </ThemeProvider>
        )
    }
}

export default App
